const Education = () => {
  return (
    <li class="mb-2">
        
      <div class="resume-degree font-weight-bold">MSc in Computer Science</div>
      <div class="resume-degree-org">University College London</div>
      <div class="resume-degree-time">2010 - 2011</div>
    </li>
  );
};

export default Education;
